class Solution:
    def __init__(self, s, min, max): 
        print(self.canReach(s, min, max))

    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        if s == '0' or s == '00': 
            return True 
            
        if '1' not in s: 
            for y in range (minJump, maxJump+1, 1): 
                if len(s) % y == 0: 
                    return True

        strlen = len(s)
        i = 0
        for j in range (minJump, maxJump+1, 1): 
            #print(f'j = {j}, s = {s}, len(s) = {strlen}')
            if (i + j) < strlen: 
                if s[(i + j)] == '0': 
                    s = s[(i+j):strlen]
                    #print(f's cut into {s}')
                    return self.canReach(str(s), minJump, maxJump)
                #else: 
                    #print(f'{s[(i + j)]} is not a landing point')
            else: 
                #print('end of array, nowhere to land')
                return False
            
